<P><A NAME="id_complexp"></A><B>(complexp <I>object</I>)</B></P>

<P>Returns <A HREF="robo8vck.htm">t</A> if <I>object</I> is a complex number, otherwise <A HREF="robo4euk.htm">nil</A>.
As there are no complex numbers implemented, this always returns nil.</P>
